Учитель истории и обществознания; 
Сопредседатель Ассоциации педагогов Ленинградской области; 
Член Всероссийского экспертного педагогического совета при Министерстве Просвещения РФ; 
Лектор Российского общества «Знание»
Лауреат Всероссийского профессионального конкурса «Учитель года-2020»;
Победитель Всероссийского профессионального конкурса «Учитель будущего»;
Руководитель программ по обществознанию в региональном центре для одаренных школьников ГБУ ДО Центр «Интеллект»; Амбассадор цифрового образования;
Член общественной палаты Ленинградской области
